import './nav.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink,
  Link
} from "react-router-dom";
function Nav(){
	return(
		<nav className="navbar navbar-expand-lg navbar-dark">
  <div className="container-fluid">
   
    <div className="collapse navbar-collapse" id="navbarNavDropdown">
      <ul className="navbar-nav">
        <li className="nav-item">
          <NavLink to="/home" className="nav-link" active className="active">Inicio</NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/quienessomos" className="nav-link" active className="active">Quienes Somos</NavLink>
        </li>
        <li className="nav-item">
         <NavLink to="/productos" className="nav-link" active className="active">Productos</NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/contactenos" className="nav-link" active className="active">Contactenos</NavLink>
        </li>
    </ul>
    </div>
  </div>
</nav>

		);
}
export default Nav;
